export const url = 'https://auth.nomoreparties.co';

export const register = (password, email) => {
  return fetch(`${url}/signup`, {
    method: 'POST',
    headers: {
      Accept: 'application/json',
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      password: password,
      email: email,
    }),
  }).then((res) => {
    if (res) {
      return res.json();
    }
  });
};
